def extract_file(lost_file):
    # TODO SHA256
    filename = ""
    if lost_file == "ntsd.exe":
        # filename = "ntsd"
        filename = ntsd_name_base64
        fileb64 = ntsd_base64
    elif lost_file == "pssuspend.exe":
        # filename = "pssuspend"
        filename = pssuspend_name_base64
        fileb64 = pssuspend_base64
    elif lost_file == "pskill.exe":
        # filename = "pskill"
        filename = pskill_name_base64
        fileb64 = pskill_base64
    f = open("{}.exe".format(filename),"wb")
    f.write(base64.b64decode(fileb64))
    f.close()

